INSERT INTO `courses` (`id`, `title`, `alias`, `created_at`, `updated_at`, `is_active`, `old_price`, `price`, `duration`, `type`, `certificate`, `soon`, `order`, `start`, `personal`, `global`, `icon_url`, `description`, `icon_color`, `preview_url`) VALUES
(29, 'Английский язык', 'angliyskiy_yazyk', 1595423022, NULL, 2, NULL, NULL, '15 уроков', 1, '', 1, 999, 1, 1, 1, NULL, '', 'yellow', '/img/course/2782340.png'),
(37, 'MLM практикум', 'mlm_predprinimately', 1631565480, NULL, 1, NULL, 103, '12 месяцев', 2, '', 2, 999, 0, 0, 0, '/img/course/4235460.svg', 'Этот курс направлен на подробное изучение и освоение профессии MLM предприниматель, а также, немедленное применение его на практике.\r\n\r\nЭто значит, что вы получите материалы для работы и мы вместе будем практиковать прямо на платформе изученный материал.\r\n\r\nКурс целиком нацелен на практику, уже более 30 000+ MLM предпринимателей успешно реализуются в данной сфере.\r\n\r\nДля кого подойдет этот курс?\r\n\r\nЕсли вы давно думали о смене профессии\r\n\r\nЕсли вы хотите получать дополнительный заработок, помимо основного дохода\r\n\r\nЕсли вы уже пробовали себя в данной профессии, но по каким-то причинам оставили ее\r\n\r\nЕсли вы уже работаете в данной сфере и не знаете, как развиваться дальше\r\n\r\nЕсли вы хотите освоить новые навыки для привлечения новых клиентов\r\n\r\nЧто внутри курса?\r\n\r\nТеория - это хорошо, но без практики результата не будет. Поэтому каждый теоретический блок заканчивается практикой, где у вас будет свой личный ментор, который будет вам помогать в освоении новой профессии.', 'blue', '/img/course/1782490.png'),
(38, 'Бизнес - Системный анализ', 'biznes_-_sistemnyy_analiz', 1631583376, NULL, 1, NULL, NULL, '1 месяц', 1, '', 2, 999, 0, 0, 0, NULL, 'Что входит в программу:\r\n\"Замер\" компетенции участников (на старте/на финише)\r\n4 воркшопа по 8 часов\r\nВедение индивидуального плана развития по каждому участнику\r\nПредоставление всей необходимой литературы\r\nОнлайн взаимодействие на протяжении всего курса \r\nРазвитие профессиональных навыков (hard skills)\r\nРазвитие универсальных компетенции (soft skills)\r\n\r\nКурс подходит:\r\nБизнес - системным аналитикам\r\nЭкономистам, финансистам, которые хотят сменить профессию\r\nНачинающим техническим специалистам, которые хотят вырасти в бизнес - аналитиков\r\nСтудентам старших курсов\r\nВыпускникам IT - специальностей\r\n\r\n', 'blue', '/img/course/1859466.png'),
(39, 'Техническая сторона маркетинга', 'tehnicheskaya_storona_marketinga', 1631599222, NULL, 1, NULL, NULL, '1 месяц', 1, '', 2, 999, 0, 0, 0, NULL, '', 'light-green', '/img/course/2249592.png');
