INSERT INTO `deposit_accounts` (`account`, `system`, `id`) VALUES
('Уважаемые пользователи, вы можете сделать пополнение баланса через платежную систему ADVcash. При этом необходимо нужную сумму отправить на ADVcash: U 6060 6902 0216  . В комментариях указать логин аккаунта пополняемого кабинета, скрин транзакции продублировать на Whatsapp +7-705-368-80-16, и еще раз повторить логин аккаунта.', 1, 1),
('Внимание!!! Уважаемые партнеры,  для пополнения своих кабинетов, можете произвести оплату на расчетный счет ТОО «Best Road Investment» в терминалах АО ДБ «Альфа Банк».\r\n                                <br>Как пополнить счет через терминал?\r\n                                <br> 1. На экране терминала заходим в меню и выбираем раздел «Для юридических лиц и ИП»\r\n                                <br>2. Далее выбираем «Пополнение текущего карточного счета»\r\n                                <br>3. На экране появится окошко, где нужно вручную заполнить БИН ТОО 190 740 028 874,\r\n                                <br>4. Далее  выбрать карточный счет ТОО, который заканчивается на 5353;\r\n                                <br>5. Далее  на экране появится полная информация о данных ТОО (БИН, название компании, первые и последние цифры счета),\r\n                                <br>6. Далее  пополняете счет,  и после полного пополнения,  терминал выдаст чек, который необходимо сфотографировать и отправить  на Whatsapp +7-705-368-80-16. НЕ ЗАБУДЬТЕ указать  ЛОГИН аккаунта пополняемого кабинета!!!\r\n                            ', 2, 2);
