(28, NULL, 2, 'Готовые материалы для размещения в соц.сетях. Тема контента: Общая', '/docs/8907874.jpg', 1, NULL, 0, 'https://drive.google.com/drive/folders/1AOs8rns4ZUB92myo-qHkJfYc-hHi9oox?usp=sharing', '<p><strong>365 идей для stories. 180 готовых статей. 190 готовых шаблонов для Canva.</strong></p>\r\n\r\n<p><strong>Контент-план на 2021 год<br />\r\nСохраните сотни часов драгоценного времени и начни постить контент уже через 5 минут!</strong></p>\r\n\r\n<p><strong>Как выглядит пост?</strong><br />\r\nКаждый пост &mdash; это готовая статья, упакованная в лаконичный дизайн в формате PNG-картинок для карусели или видео-ролика.<br />\r\nРедактируйте текст, изменяйте дизайн или берите готовый пост.<br />\r\nНе нужно ничего придумывать. Скопировал-вставил.</p>\r\n\r\n<p><strong>4 основных рубрики: сетевой, саморазвитие, психология, питание и спорт.</strong><br />\r\nКарусель на 5-10 картинок размером 1080x1350px<br />\r\nШаблон для редактирования дизайна в Canva.com</p>\r\n\r\n<p><strong>Чтобы создать Stories, вам понадобится 60 секунд!</strong><br />\r\n#1: Откройте календарь и выберите тему дня<br />\r\n#2: Выберите любое фото/видео или используйте готовый шаблон<br />\r\n#3: Адаптируйте дизайн в Canva, если нужно<br />\r\n#4: Вставьте текст или запишите видео по сценарию<br />\r\n#5: Разместите Stories!</p>\r\n'),
(55, NULL, 1, 'Свидетельство о регистрации BRI inc.', '/docs/3184114.pdf', 1, NULL, 0, '/docs/3184114.pdf', ''),
