INSERT INTO `lessons` (`id`, `title`, `vimeo_link`, `youtube_link`, `private`, `course_id`, `part_id`, `position`, `free`, `description`, `homework`, `icon`, `image_url`) VALUES
(78, 'Alphabets.', 'https://vimeo.com/437618290', '', NULL, 29, 32, 1, 0, '', '<ul>\r\n	<li>&nbsp;L<span style=\"font-size:14px\">earn all the alphabets and recite it from A to Z. You can record a video or audio and attach your link with it here or post it in instagram with hashtag #gcfcompany.</span></li>\r\n	<li><span style=\"font-size:14px\">&nbsp;T</span><span style=\"font-size:14px\">ry to find a new word for each alphabet, write it down and send it to us. You can use internet for it or any other help</span>.</li>\r\n</ul>\r\n', 'https://i.vimeocdn.com/video/923211405_640x360.jpg?r=pad', NULL),
(79, 'Self introduction.', 'https://vimeo.com/437620433', '', NULL, 29, 32, 2, 0, '', '<ul>\r\n	<li><strong><span style=\"font-size:14px\">write a small self introduction about yourself and send it to us </span></strong></li>\r\n	<li><strong><span style=\"font-size:14px\">try to make a video or audio with a short self introduction and send the link with a video to us (you can use https://cloud.mail.ru/ or any other website to send your video files)</span></strong></li>\r\n</ul>\r\n', 'https://i.vimeocdn.com/video/923215199_640x360.jpg?r=pad', NULL),
(80, 'About family.', 'https://vimeo.com/437622675', '', NULL, 29, 32, 3, 0, '', '<p><strong><span style=\"font-size:16px\">Watch the video and learn all the family members mentioned there.<br />\r\nWrite and send to us the names of your family members.</span></strong></p>\r\n\r\n<ul>\r\n	<li>THE NAME OF MY FATHER IS &hellip;.</li>\r\n	<li>THE NAME OF MY MOTHER IS &hellip;.</li>\r\n	<li>THE NAME OF MY SON IS &hellip; (optional)</li>\r\n	<li>THE NAME OF MY DAUGHTER IS &hellip; (optional)</li>\r\n	<li>THE NAMES OF MY CHILDREN ARE &hellip; (optional)</li>\r\n	<li>OR THE NAME OF MY GRANDFATHER IS &hellip;..</li>\r\n	<li>OR THE NAME OF MY GRANDMOTHER IS &hellip;</li>\r\n</ul>\r\n\r\n<p><strong><span style=\"font-size:14px\">Good luck! If you have any questions or suggestions you can always contact us.</span></strong></p>\r\n', 'https://i.vimeocdn.com/video/923216411_640x360.jpg?r=pad', NULL),
(81, 'About professions.', 'https://vimeo.com/437623495', '', NULL, 29, 32, 4, 0, '', '<ul>\r\n	<li><strong><span style=\"font-size:16px\">&nbsp;Watch the video and learn all the professions mentioned there. </span></strong></li>\r\n	<li><strong><span style=\"font-size:16px\">&nbsp;Find 5 more new professions, learn it and send it to us. </span></strong></li>\r\n</ul>\r\n\r\n<p><strong><span style=\"font-size:16px\">Good luck! If you have any questions or suggestions you can always contact us</span></strong>.</p>\r\n', 'https://i.vimeocdn.com/video/923219977_640x360.jpg?r=pad', NULL),
(82, 'Numbers.', 'https://vimeo.com/439316354', '', NULL, 29, 32, 5, 0, '', '<p><span style=\"font-size:16px\"><strong>1. Watch the video and learn all the numbers mentioned there.<br />\r\n2. Write these numbers in words: 12, 19, 39, 42, 58, 63, 78, 85, 93, 95, 105, 121, 130, 1006, 1050.<br />\r\n3. Write these words in numbers: eleven, fifteen, three, nine, twenty four, thirty one, forty five, sixty eight, ninety nine,&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; sixty, ninety three, two, hundred, three million, five thousand, two hundred ten. </strong></span><br />\r\n<br />\r\n<strong><span style=\"font-size:16px\">Good luck! If you have any questions or suggestions you can always contact us.</span></strong></p>\r\n', 'https://img.youtube.com/vi//0.jpg', NULL),
(83, 'Noun. Article.', 'https://vimeo.com/439709529', '', NULL, 29, 32, 6, 0, '', '<p><strong><span style=\"font-size:16px\">Put the correct article in front of the nouns (A/AN):</span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:16px\">Door , orange, house, airport, cat, eagle, investment, object, uncle, umbrella, idea, illustration, ocean, address, angel, education, effort, bottle, lion, telephone, chair, step.</span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:16px\">Good luck! If you have any questions or suggestions you can always contact us.</span></strong></p>\r\n', 'https://i.vimeocdn.com/video/926674400_640x360.jpg?r=pad', NULL),
(84, 'Subjective pronoun', 'https://vimeo.com/439707690', '', NULL, 29, 32, 7, 0, '', '<p><strong><span style=\"font-size:16px\">1. Watch the video and learn all the subjective pronouns.</span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:16px\">2. Write a new sentence for each subjective pronoun with the word &laquo;student&raquo;. Have a look example 2, with the word &laquo;doctor&raquo; and just try to copy it. </span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:16px\">3. Open the brackets and replace a noun with suitable subjective pronoun. </span></strong></p>\r\n\r\n<p><span style=\"font-size:16px\">(Castro) is a doctor. - He is a doctor. (Elena) is a teacher. (Cristiano) plays football. (Elena and Castro) are friends. (I, Castro and Cristiano) are brothers. (This orange) is so sweet.</span></p>\r\n\r\n<p><strong><span style=\"font-size:16px\">Good luck! If you have any questions or suggestions feel free to contact us.</span></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'https://i.vimeocdn.com/video/926670877_640x360.jpg?r=pad', NULL),
(85, 'The verb «to be».', 'https://vimeo.com/441356674', '', NULL, 29, 32, 8, 0, '', '<p><strong><span style=\"font-size:16px\">1. Watch the video carefully and try to practice new words. </span></strong></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>2. Open the brackets and put the verb &laquo;to be&raquo; in correct form according to the subjective pronoun.</strong></span></p>\r\n\r\n<p><span style=\"font-size:16px\">I (to be) a fire fighter. He (to be) 26 years old. She (to be) a flight attendant. It (to be) a dog. We (to be) a family. You (to be) my friend. They (to be) dancers. I (to be) a musician. He (to be) a driver. She (to be) my sister. It (to be) a house. We (to be) brothers. You (to be) a good parents. They (to be) children. </span></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>3. Try to find a new example with the verb &laquo;to be&raquo; for each subjective pronoun and write it down with the contraction (I&rsquo;m a singer, He&rsquo;s a doctor.. and etc.) </strong></span></p>\r\n\r\n<p><strong><span style=\"font-size:16px\">If you have any questions, don&rsquo;t hesitate to ask. Thank you very much. Good luck.</span></strong></p>\r\n', 'https://i.vimeocdn.com/video/929445496_640x360.jpg?r=pad', NULL),
(86, 'Objective pronouns.', 'https://vimeo.com/441361718', '', NULL, 29, 32, 9, 0, '', '<p><strong><span style=\"font-size:16px\">1.Watch the video carefully and try to practice new words. </span></strong></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>2.Open the brackets and change the subjective pronoun to the objective pronoun. </strong></span></p>\r\n\r\n<p><span style=\"font-size:16px\">Example: I love (he). - I love him. I love (she). I love (they). I love (it). Mike sings for (I). Mike sings for (she). Mike sings for (you). Elena dances with (we). Elena dances with (he). Elena dances with (they). Kate like (it). Kate teaches (I). Kate teaches (he). Kate teaches (we). I am happy with (you). I am happy with (he). I am happy with (they). </span></p>\r\n\r\n<p><strong><span style=\"font-size:16px\">If you have any questions, don&rsquo;t hesitate to ask. Thank you very much. Good luck.</span></strong></p>\r\n', 'https://i.vimeocdn.com/video/929454208_640x360.jpg?r=pad', NULL),
(87, 'PRACTICAL SESSION.', 'https://vimeo.com/443093268', '', NULL, 29, 32, 10, 0, '', '', 'https://i.vimeocdn.com/video/932448930_640x360.jpg?r=pad', NULL),
(105, 'Singular and plural nouns.', 'https://vimeo.com/447454732', '', NULL, 29, 32, 11, 0, '', '<p><strong><span style=\"font-size:16px\">Change these singular nouns to plural:</span></strong><br />\r\n<span style=\"font-size:16px\">Table, spoon, phone, cow, car, plant, book, rock, friend, hat, lamp, teacher, park, toy, zebra, store,<br />\r\ndish, peach, couch, brush, fox, wish, lunch, boss, company, berry, story.</span></p>\r\n\r\n<p><strong><span style=\"font-size:16px\">Good luck! If you have any questions feel free to contact us.</span></strong></p>\r\n', 'https://img.youtube.com/vi//0.jpg', NULL),
(111, 'The verb \"to be\". Negative form.', 'https://vimeo.com/448468619', '', NULL, 29, 32, 12, 0, '', '<p><strong><span style=\"font-size:16px\">Change these sentences in positive form to negative.</span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:16px\">1) I am a doctor.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 11) She is a dancer.&nbsp;&nbsp;<br />\r\n2) She is a nurse.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 12) I am a father.<br />\r\n3) He is a fire fighter.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 13) They are parents.<br />\r\n4) They are my friends.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 14) It is an apple.<br />\r\n5) I am at home.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 15) It is a chair.<br />\r\n6) We are in the park.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;16) We are brothers<br />\r\n7) He is very funny.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 17) He is a pilot.<br />\r\n8) They are in Italy.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;18) You are my friend.<br />\r\n9) You are actors.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;19) She is a nanny.<br />\r\n10) It is my new laptop.&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;20) Kate is my neighbour.</span></strong></p>\r\n', 'https://i.vimeocdn.com/video/941486529_640x360.jpg?r=pad', NULL),
(112, 'General questions with verb \"to be\".', 'https://vimeo.com/448469059', '', NULL, 29, 32, 13, 0, '', '<p><span style=\"font-size:16px\"><strong>Change these positive and negative sentences with the verb &laquo;to be&raquo; to the question sentences.</strong></span></p>\r\n\r\n<p><span style=\"font-size:16px\">We are brothers. She is a dancer. You are my friend. I am a doctor. She is a nurse. He is a fire fighter. They are my friends. I am at home. We are not in the park. He is not very funny. They are in Italy. You are actors. It is not my new laptop. I am a father. They are parents. It is an apple. It is a chair. He is a pilot. She is not a nanny. Kate is my neighbour. It is a pen. It is not your car. It is my house.</span></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>Good luck! If you have any questions feel free to contact us.</strong></span></p>\r\n', 'https://i.vimeocdn.com/video/941487489_640x360.jpg?r=pad', NULL),
(113, 'English calendar.', 'https://vimeo.com/448528304', '', NULL, 29, 32, 14, 0, '', '<p><strong>Match 12 monthes of the year according to the seasons. </strong></p>\r\n\r\n<p><em>For example, December - winter.</em></p>\r\n\r\n<p>November, April,&nbsp; January, March, June, February, September, July, August, October, May, December .</p>\r\n\r\n<p><strong>Good luck! If you have any questions feel free to contact us.</strong></p>\r\n', 'https://i.vimeocdn.com/video/941587753_640x360.jpg?r=pad', NULL),
