(159, 'Экскурс в профессию', 'player.vimeo.com/video/603817681', '', NULL, 38, 50, 1, 1, '<p>WORKSHOP #1</p>\r\n\r\n<p>&quot;Экскурс в профессию&quot;</p>\r\n\r\n<p>Что такое информационная система и их разновидности</p>\r\n\r\n<p>Проекты (типы проектов, жизненный цикл)</p>\r\n\r\n<p>Методологии разработки</p>\r\n\r\n<p>Общие методы анализа</p>\r\n\r\n<p>Требования (типы требовании, классификации/систематизация)</p>\r\n\r\n<p>Основы моделирования</p>\r\n', '', NULL, NULL),
(160, 'Моделирование предметной области', 'player.vimeo.com/video/603889086', '', NULL, 38, 51, 1, 1, '<p>WORKSHOP #2</p>\r\n\r\n<p>&quot;Моделирование предметной области&quot;</p>\r\n\r\n<p>Что такое модель/моделирование?</p>\r\n\r\n<p>Виды моделей</p>\r\n\r\n<p>Нотации моделирования (концептуальный, логический и физический&nbsp;уровни)</p>\r\n\r\n<p>UML. Разбор самых распространенных диаграмм</p>\r\n\r\n<p>Рассмотрение конкретных примеров</p>\r\n\r\n<p>Практикум</p>\r\n', '', NULL, NULL),
(161, 'Моделирование бизнес-процессов', 'https://player.vimeo.com/video/603916860', '', NULL, 38, 52, 1, 1, '<p>WORKSHOP #3</p>\r\n\r\n<p>&quot;Моделирование бизнес-процессов&quot;</p>\r\n\r\n<p>Что такое бизнес-процессы?</p>\r\n\r\n<p>Система условных обозночений &quot;BPMN&quot;</p>\r\n\r\n<p>Инструменты моделирования бизнес-процессов</p>\r\n\r\n<p>Разбор реальных примеров</p>\r\n\r\n<p>Документирование моделей бизнес-процессов</p>\r\n\r\n<p>Практикум</p>\r\n', '', NULL, NULL),
(162, 'Об интерфейсах', 'https://player.vimeo.com/video/604400635', '', NULL, 38, 53, 1, 1, '<p>WORKSHOP #4</p>\r\n\r\n<p>&quot;Об интерфейсах&quot;</p>\r\n\r\n<p>Что такое интерфейсы? Какие они бывают?</p>\r\n\r\n<p>UX и UI, в чем их разница?</p>\r\n\r\n<p>Мокапы, эскизы, прототипы (web, desktop, mobile app)</p>\r\n\r\n<p>Инструменты проектирования форм интерфейсов</p>\r\n\r\n<p>FRONT END - разработка (обзор стека технологий, инструменты)</p>\r\n\r\n<p>Документирование мокапов, версионность</p>\r\n\r\n<p>Практикум</p>\r\n', '', NULL, NULL);
INSERT INTO `lessons` (`id`, `title`, `vimeo_link`, `youtube_link`, `private`, `course_id`, `part_id`, `position`, `free`, `description`, `homework`, `icon`, `image_url`) VALUES
(163, 'Вводный урок', 'https://vimeo.com/604416103', '', NULL, 37, 54, 1, 1, '<p><!--(figmeta)eyJmaWxlS2V5IjoiY0FmUVVmckQyMkttNmJ2aGVrTHVOeCIsInBhc3RlSUQiOjg0NjU5OTQwNCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)--><!--(figma)(/figma)-->Этот курс направлен на подробное изучение и освоение профессии MLM предприниматель, а также, немедленное применение его на практике.<br />\r\n<br />\r\nЭто значит, что вы получите материалы для работы и мы вместе будем практиковать прямо на платформе изученный материал.<br />\r\n<br />\r\nКурс целиком нацелен на практику, уже более 30 000+ MLM предпринимателей успешно реализуются в данной сфере.<br />\r\n<br />\r\nДля кого подойдет этот курс?</p>\r\n\r\n<ul>\r\n	<li>Если вы давно думали о смене профессии</li>\r\n	<li>Если вы хотите получать дополнительный заработок, помимо основного дохода</li>\r\n	<li>Если вы уже пробовали себя в данной профессии, но по каким-то причинам оставили ее</li>\r\n	<li>Если вы уже работаете в данной сфере и не знаете, как развиваться дальше</li>\r\n	<li>Если вы хотите освоить новые навыки для привлечения новых клиентов</li>\r\n</ul>\r\n\r\n<p>Что внутри курса?<br />\r\n<br />\r\nТеория - это хорошо, но без практики результата не будет. Поэтому каждый теоретический блок заканчивается практикой, где у вас будет свой личный ментор, который будет вам помогать в освоении новой профессии.</p>\r\n', '', NULL, NULL),
(164, 'Вводная DIGI', '', 'https://www.youtube.com/watch?v=VgpvHlWIJAQ&list=PLqvIQxk6cz6fox5Ayx6J2qrBFhN-moKQx&index=1', NULL, 39, 55, 1, 1, '<h2><strong>Чему вы научитесь</strong></h2>\r\n\r\n<ul>\r\n	<li>Делать дизайн без знания графических программ.</li>\r\n	<li>Как создавать вижуалы разного формата и сложности.</li>\r\n	<li>Как создавать статичные баннеры, для рекламы в сторис.</li>\r\n	<li>Как составлять качественный контент-план на месяц.</li>\r\n	<li>Научим автоматизации постинга. Как заранее загрузить, чтобы посты сами публиковались.</li>\r\n	<li>Научим как писать, о чем писать и откуда брать идеи.</li>\r\n	<li>Научим делать презентации, инструкции для своих партнеров.</li>\r\n	<li>Научитесь делать видеоролики для социальных сетей.</li>\r\n	<li>Как открывать и правильно оформлять свой ютуб канал.</li>\r\n	<li>Как продвигать свои видео, и выводить в топ.</li>\r\n	<li>Как записывать качественный онлайн видео-контент для ютуб канала.</li>\r\n	<li>Как записывать видео-инструкции и какие программы использовать.</li>\r\n	<li>Научитесь настраивать таргетинговую рекламу и генерировать трафик на свою.</li>\r\n	<li>Рассмотрим несколько видов трафика.</li>\r\n	<li>Сервисы для автоматизации потока заявок.</li>\r\n	<li>Настроив один раз получаете постоянно эргономический трафик.</li>\r\n	<li>Создадим воронку, которая будет работать за вас, делать презентации, вам только остается работать с теми, кто готов включиться в команду.</li>\r\n	<li>Как привлекать партнеров в свой бизнес через соц.сети<em> </em></li>\r\n</ul>\r\n', '', 'https://img.youtube.com/vi/watch?v=VgpvHlWIJAQ&list=PLqvIQxk6cz6fox5Ayx6J2qrBFhN-moKQx&index=1/0.jpg', NULL),
