(13, NULL, 1, 'ОСТЕРЕГАЙТЕСЬ МОШЕННИКОВ...', '/docs/2372594.png', 1, 999, 0, '<p><strong>Уважаемые пользователи!&nbsp;</strong></p>\r\n\r\n<p><strong>Остерегайтесь мошенников, будьте бдительны, удостоверьтесь в благонадежности ваших вышестоящих партнеров!</strong></p>\r\n\r\n<p>Убедитесь, что вы находитесь на правильном сайте и за правильно выбранным вами спонсором!</p>\r\n\r\n<p><strong>На рынке появилось много мнимых программ Shanyrak Plus, которых создают мнимые чаты и прикрываются нашей программой, создают разного рода вскладчины &quot;сборники&quot;, но по факту к нам они никакого отношения не имеют!</strong></p>\r\n\r\n<p>За участие в таких чатах компания ответственности не несет, лидеры принимающие участие в них, будут терминироваться!</p>\r\n\r\n<p>Еще раз предупреждаем, будьте&nbsp; бдительны, не дайте себя обмануть!!!</p>\r\n\r\n<hr />\r\n<div>&nbsp;</div>\r\n\r\n<div><strong>3.3. Пользователям запрещается:</strong></div>\r\n\r\n<div>3.3.1. заниматься пригласительной деятельностью пока полностью не изучит&nbsp;инструмент - маркетинг план;</div>\r\n\r\n<div>3.3.2. игнорировать своего Куратора (исключение составляют пользователи,&nbsp;имеющие свою собственную партнерскую структуру не менее 50 человек).</div>\r\n\r\n<div>3.3.3. создавать и применять стратегии, ограничивающие права и свободу действий&nbsp;Пользователей Сообщества, создавать чаты, где предлагают работать вскладчину, &laquo;сборники&raquo;;</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><strong>3.4. Постоянные или крупные вложения денежных средств в партнерскую структуру&nbsp;не являются активной деятельностью в Сообществе.&nbsp;</strong></div>\r\n\r\n<div>Случаи злоупотребления рассматриваются как неправильное использование системы.&nbsp;</div>\r\n\r\n<div>При выявлении данного нарушения Администрация вправе обратится к Пользователю для выяснения причины данных действий и рассматривать каждый такой случай отдельно.</div>\r\n\r\n<p><strong>С уважением, Администрация!</strong></p>\r\n', 1609403877),
