(16, NULL, 1, 'Вот и завершилось двухдневное бизнес событие в Алматы.', '/docs/8830220.jpg', 1, 999, 0, '<p>Благодарим Вас за то, что были с нами, 13-14 марта, на бизнес событии компании BRI.</p>\r\n\r\n<p>Было много профессиональных спикеров и полезных кейсов.<br />\r\nНадеемся, что переданные знания пригодятся Вам для успешной работы и построения масштабной команды!</p>\r\n\r\n<p><strong>В ближайшее время объявим новый промоушен на событие в Турции!<br />\r\nНасладитесь атмосферой нашего предстоящего мероприятия</strong><br />\r\n<a href=\"https://www.youtube.com/watch?v=w5PptUsDKxg\">https://www.youtube.com/watch?v=w5PptUsDKxg</a></p>\r\n\r\n<p><strong>А пока предлагаем зарядиться энергией с прошедшего события в Алматы:</strong><br />\r\n<a href=\"https://www.youtube.com/watch?v=6_A5Vo9Ijuc&amp;t=533s\">https://www.youtube.com/watch?v=6_A5Vo9Ijuc&amp;t=533s</a></p>\r\n\r\n<p><strong>Отзывы партнеров</strong><br />\r\n<a href=\"https://www.youtube.com/playlist?list=PLKWKYEpmX-Zb-v9k1hybuOSYA5Ltn-hd-\">https://www.youtube.com/playlist?list=PLKWKYEpmX-Zb-v9k1hybuOSYA5Ltn-hd-&nbsp;</a></p>\r\n\r\n<p><strong>Фотоотчет 1 дня:</strong><br />\r\n<a href=\"https://disk.yandex.ru/d/3ASEZw2H85NoAQ?w=1\">https://disk.yandex.ru/d/3ASEZw2H85NoAQ?w=1</a></p>\r\n\r\n<p><strong>Фотоотчет 2 дня:</strong><br />\r\n<a href=\"https://disk.yandex.ru/d/UvBhj9XGFUcjPQ?w=1\">https://disk.yandex.ru/d/UvBhj9XGFUcjPQ?w=1&nbsp;&nbsp;</a></p>\r\n\r\n<p><strong>Присоединяйтесь к нам!</strong><br />\r\n<a href=\"https://bestroadinvestment.com\">https://briincorp.com</a><a href=\"https://briincorp.com\">&nbsp;</a><br />\r\n<a href=\"https://instagram.com/bestroadinvestment\">https://instagram.com/</a><a href=\"https://bestroadinvestment.com\">briincorp</a><br />\r\n<a href=\"https://t.me/bestroadinvestment\">https://t.me/</a><a href=\"https://bestroadinvestment.com\">briincorp</a></p>\r\n\r\n<p>&nbsp;</p>\r\n', 1616086726),
(17, NULL, 1, 'Новая промокампания: Масштабное событие в Турции!', '/docs/3534040.png', 1, 999, 0, '<p><strong>Уважаемые партнёры! </strong></p>\r\n\r\n<p>Компания BRI&nbsp;выражает вам свою глубокую признательность за доверие и сотрудничество!</p>\r\n\r\n<p>Каждый день наше сообщество растёт невероятно быстрыми темпами. Вместе с этим, &nbsp;для нас становится стратегически важным профессиональный рост каждого активного партнера, ведь это является залогом надёжности и долговечности нашего бизнеса.</p>\r\n\r\n<p>Поэтому на первое место мы ставим образование, которое будет полезным как в бизнесе, так и в жизни.</p>\r\n\r\n<p><strong>Поэтому мы организуем масштабное событие в Турции, которое пройдёт с 20&nbsp;по 27&nbsp;июня.</strong></p>\r\n\r\n<p>Анталья &ndash; это курортный город, который славится своими пляжами, шикарными отелями и Старой гаванью, где швартуются яхты и круизные лайнеры. Он расположен на Турецкой Ривьере &ndash; участке средиземноморского побережья Турции, который привлекает туристов благодаря прозрачным голубым водам.</p>\r\n\r\n<p><strong>Вас ждут 7 дней активной прокачки и отдыха в 5-ти звёздочном отеле на берегу моря.</strong></p>\r\n\r\n<p>Вы получите незабываемые впечатления, море позитивной энергии, необходимые знания для профессионального роста, практический опыт в разных областях, новые знакомства с единомышленниками из разных стран, ценные призы и подарки.</p>\r\n\r\n<p><strong>Эта поездка не оставит равнодушным!</strong></p>\r\n\r\n<p><strong>Чтобы стать участником данного события, нужно приложить небольшие усилия и сделать следующий объём личных продаж:</strong></p>\r\n\r\n<ul>\r\n	<li>Билет первой категории: 120 билетов, 450 GRC личных продаж (в розыгрыше призов участие не принимает)</li>\r\n	<li>Билет второй категории: 110 билетов, 600 GRC личных продаж&nbsp;(розыгрыш 22-х золотых слитков весом 5 граммов)</li>\r\n	<li>Билет третьей категории: 50 билетов, 800 GRC личных продаж&nbsp;(розыгрыш 10-ти бриллиантовых наборов или золотых перстней с бриллиантами)</li>\r\n	<li>Билет четвёртой категории: 20 билетов, 1000 GRC&nbsp;личных продаж&nbsp; (розыгрыш 5-ти именных, золотых часов)</li>\r\n</ul>\r\n\r\n<p><strong>P.S. ВСЕ ВКЛЮЧЕНО: ПЕРЕЛЕТ+ПРОЖИВАНИЕ+ПРОГРАММА</strong></p>\r\n', 1616261795),
