(4, 'Общая информация', 'О программе Шанырак', '', NULL, NULL, 'Социальная программа «Shanyrak»\r\nСоздана для улучшения и решения   проблем Пользователей онлайн платформы GCF, с правом получения комфортных условий по приобретению жилья, автомобиля, бытовой техники и других ценностей.'),
(5, 'Недвижимость', 'Информация о программе недвижимости', '/img/pr1.jpg', 1, '390.00', 'Компания GCF дает возможность приобрести недвижимость в рассрочку в Казахстане, странах СНГ и дальнего зарубежья.'),
