INSERT INTO `tlgrm_steps` (`id`, `step`, `created_at`, `updated_at`, `step_text`) VALUES
(1, 1, 1606451523, NULL, 'https://www.youtube.com/watch?v=SNWW_2L12Hg'),
(2, 2, 1606451559, NULL, '«SHANYRAK+» - это лучший способ реализовать свою мечту о собственном жилье.\r\nВ этом интерактиве мы поделимся с вами самым важным о нашей компании, и партнерской программе «Shanyrak+».\r\n'),
(3, 3, 1606451580, NULL, 'https://www.youtube.com/watch?v=P8p3Je2qlCA '),
(4, 4, 1606451629, NULL, 'Компания \"Best Roаd Investment\" предлагает дома, построенные по канадской технологии - красивые, комфортабельные, надежные, оптимальные по всем показателям, недорогие.\r\nНаше жилье построено из стройматериалов, не содержащих вредных для здоровья человека веществ. А благодаря отличной теплоизоляции счета за отопление в таких домах самые низкие.\r\n\r\nА сейчас предлагаем вам посмотреть пример подобного дома!\r\n'),
(5, 5, 1606451650, NULL, 'Обзор готового дома программы SHANYRAK \r\nhttps://youtu.be/QyZePVklz9E\r\n'),
(6, 6, 1606451677, NULL, 'В этом интерактиве вы можете не только слушать, но и вести полноценный диалог. Мы будем вам благодарны, если вы сейчас немного расскажете о себе. Пожалуйста, напишите короткие сообщения на несколько вопросов. Как вас зовут? Из какого вы города? Откуда узнали о возможности?'),
(7, 7, 1606451700, NULL, 'https://www.youtube.com/watch?v=ENIB8ekzvfc'),
(8, 8, 1606451725, NULL, 'Далее вам будет предложена анкета, для ответа на вопрос отправляйте сообщение, если хотите пропустить вопрос, то нажмите ✅ Далее'),
(9, 9, 1606451757, NULL, 'Как вас зовут?'),
(10, 10, 1606451782, NULL, 'Из какого вы города?'),
(11, 11, 1606451800, NULL, 'Откуда узнали о партнерской программе “SHANYRAK+»?'),
(12, 12, 1606451818, NULL, 'https://www.youtube.com/watch?v=YgZQWxvnrx8'),
(13, 13, 1606451523, NULL, '«SHANYRAK+» имеет ценную партнерскую программу, которая дает всем равные возможности заработать на собственную недвижимость, на свои ежедневные потребности, для реализации мечты своей семьи! \r\nВот подробное видео!\r\n'),
(14, 14, 1606451523, NULL, 'https://www.youtube.com/watch?v=gEKWyulnnds'),
(15, 15, 1606451523, NULL, 'Отличительные особенности маркетинг – плана:\r\n\r\n•	Матричная модель ведения бизнеса;\r\n•	Шесть бизнес-площадок;\r\n•	Четыре вида дохода;\r\n•	Автоматическая дупликация бизнес-мест;\r\n•	Система управления бизнес-структурой;\r\n\r\nА вот ссылка на маркетинг в формате PDF https://shanyrakplus.com/bot/shanyrakplus.pdf\r\n'),
(16, 16, 1606451523, NULL, 'По всему миру написаны сотни книг о саморазвитии и личностном росте. Читая их, каждый может увеличить свой личностный потенциал по всем направлениям жизни. При вступлении в партнерскую программу «SHANYRAK+» вы получаете доступ к уникальной закрытой библиотеке.\r\nА теперь давайте поговорим о наших инструментах автоматизации. О том, как сделать так, чтобы бизнес работал самостоятельно. Это будет интересно!'),
(17, 17, 1606451523, NULL, 'https://www.youtube.com/watch?v=l3y-fL_BdDA'),
(18, 18, 1606451523, NULL, 'Первым и незаменимым помощником в нашем бизнесе является чат –бот, в котором вы сейчас находитесь. Он делает за нас 90% всей работы. Он самостоятельно рассказывает об основной идее нашего предложения. Вам достаточно просто выслать ссылку на него максимальному количеству людей и провести консультацию по готовому скрипту с теми людьми, которым будет интересна эта идея. '),
(19, 19, 1606451523, NULL, 'https://www.youtube.com/watch?v=spMrR9v94ho'),
(20, 20, 1606451523, NULL, 'Каждый наш новый партнер получает аналогичную систему, зарабатывает хорошие деньги и получает дома. Все происходит легко, быстро и в комфортных условиях!\r\nТакже у нас ежедневно проходят живые встречи и онлайн вебинары, на которых выступают лидеры компании и делятся своими знаниями и опытом.\r\nС вами всегда рядом ваши наставники, которые готовы помочь и поддержать.\r\nВ следующем видео вы увидите, как выглядит личный кабинет и как оплатить пакет.'),
(21, 21, 1606451523, NULL, 'https://www.youtube.com/watch?v=HIbw6rxxfSI\r\n'),
(22, 22, 1606451523, NULL, 'В личном кабинете простой и понятный интефейс.  Вы легко сможете наблюдать развитие своего бизнеса и управлять им. \r\nИ последний шаг…'),
(23, 23, 1606451523, NULL, 'https://www.youtube.com/watch?v=crfU7cQzoUk\r\n'),
(24, 24, 1606451523, NULL, 'Партнерская программа «SHANYRAK+» - это простая понятная бизнес – модель, которая дает всем равные возможности на исполнение своей мечты!\r\n'),
(25, 25, 1606451523, NULL, 'https://www.youtube.com/watch?v=dCw-tQT4ePM\r\n\r\n'),
(26, 26, 1606451523, NULL, 'Пожалуйста, свяжитесь с человеком, пригласившим вас пройти этот интерактив или напишите вопрос в нашу техподдержку, вам ответит наш менеджер.  Поделитесь своим мнением об этом интерактиве, задайте оставшиеся вопросы. Вам дадут рекомендации по дальнейшим шагам и помогут активировать ваш аккаунт.\r\nДля более полной информации у нас ежедневно проводятся живые вебинары. Там вы сможете увидеть действующих партнеров компании и получить более полную информацию. Расписание вебинаров вы также можете получить у нашего Пригласителя.\r\n\r\nСпасибо вам за время, которые мы провели вместе. Надеюсь, это было полезно!\r\nВсего наилучшего и...  остаемся на связи!');
